def hamming_distance(s, t):
    """Calculate the Hamming distance between two DNA strings."""
    if len(s) != len(t):
        raise ValueError("Input strings must have equal length.")

    return sum(ch1 != ch2 for ch1, ch2 in zip(s, t))
s = ""
t = ""

print(hamming_distance(s, t))  # Output: 7
